import Gitlet from "../../assets/home/Gitlet.png";

let description =
  "Gitlet is a version control system imitating some basic functionality of Git. Features include checking out old versions of files, merging branches, and more.";

const dataGL = {
  name: "Gitlet",
  mainPic: Gitlet,
  fullID: "gitlet",
  alt: "Gitlet: Lightweight version control system inspired by Git",
  subheading: "Light Version Control System",
  description: description,
  technology: "Java",
  link: "https://github.com/DevonMartin/Gitlet",
};

export default dataGL;
